import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function createData(state, cases, deaths, recovered) {
  return { state, cases, deaths, recovered };
}

const rows = [createData("California", 0, 0, 0)];

export default function SimpleTable() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell className="marginLeft">State</TableCell>
            <TableCell className="marginLeft">Confirmed Cases</TableCell>
            <TableCell className="marginLeft">Confirmed Deaths</TableCell>
            <TableCel className="marginLeft" l>
              Confirmed Recovered
            </TableCel>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell>{row.state}</TableCell>
              <TableCell>{row.cases}</TableCell>
              <TableCell>{row.deaths}</TableCell>
              <TableCell>{row.recovered}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
